import React from 'react';

const Cart = ({ cart }) => {
  const totalCost = cart.reduce((total, item) => total + item.price, 0);
  
  return (
    <div>
      <h1>Your Cart</h1>
      {cart.map((product, index) => (
        <div key={index}>
          <h2>{product.title}</h2>
          <p>${product.price}</p>
        </div>
      ))}
      <h3>Total: ${totalCost}</h3>
    </div>
  );
};

export default Cart;
